&lt;p&gt;&lt;a href=&quot;http://genk.vn/vo-mong-voi-galaxy-note-fan-edition-note-7-fe-dau-tien-vua-ve-den-viet-nam-gia-tan-16-trieu-dong-20170707103548515.chn&quot; target=&quot;_blank&quot;&gt;Như ch&uacute;ng t&ocirc;i đ&atilde; đưa tin, những chiếc Galaxy Note Fan Edition (hay Galaxy Note FE) đầu ti&ecirc;n đ&atilde; về Việt Nam v&agrave;o ng&agrave;y h&ocirc;m nay, 7/7, c&ugrave;ng thời điểm mở b&aacute;n tại H&agrave;n Quốc.&lt;/a&gt;&nbsp;Kh&aacute;c với một số th&ocirc;ng tin cho biết Galaxy Note FE sẽ được t&acirc;n trang lại từ những chiếc m&aacute;y từng bị thu hồi từ người d&ugrave;ng trước đ&acirc;y, th&igrave; đ&acirc;y thực chất đều l&agrave; m&aacute;y mới, được Samsung chế tạo từ linh kiện chưa sử dụng v&agrave; c&aacute;c m&aacute;y chưa từng được b&oacute;c hộp.&lt;/p&gt;

&lt;p&gt;Thay đổi đ&aacute;ng kể duy nhất của Note FE l&agrave; dung lượng pin được suy giảm c&ograve;n 3200mAh so với mức 3500mAh của chiếc Note7 nguy&ecirc;n bản. Vi&ecirc;n pin mới của Note FE đ&atilde; được kiểm tra kỹ c&agrave;ng, bao gồm việc vượt qua quy tr&igrave;nh kiểm định pin 8 bước m&agrave; Samsung từng &aacute;p dụng cho Galaxy S8. V&igrave; vậy, c&oacute; thể n&oacute;i Galaxy Note FE l&agrave; một chiếc m&aacute;y an to&agrave;n. Tuy nhi&ecirc;n, c&oacute; lẽ người d&ugrave;ng vẫn sẽ kh&ocirc;ng thể đưa chiếc m&aacute;y n&agrave;y l&ecirc;n m&aacute;y bay ở thời điểm hiện tại.&lt;/p&gt;

&lt;p&gt;Chiếc Galaxy Note FE n&agrave;y hiện c&oacute; gi&aacute; 16 triệu đồng tại Việt Nam, cao hơn rất nhiều so với mức 10-11 triệu đồng m&agrave; nhiều cửa h&agrave;ng từng hứa hẹn với kh&aacute;ch h&agrave;ng. Với mức gi&aacute; n&agrave;y, đa số người d&ugrave;ng sẽ bỏ qua Galaxy Note FE v&agrave; chuyển hướng sang bộ đ&ocirc;i Galaxy S8 v&agrave; S8+ đời mới hơn từ ch&iacute;nh Samsung. Một số người d&ugrave;ng kh&aacute;c th&igrave; sẽ tiếp tục chờ đợi thế hệ Galaxy Note tiếp theo, dự kiến sẽ ra mắt v&agrave;o th&aacute;ng 8 hoặc th&aacute;ng 9. Tuy nhi&ecirc;n, nếu bạn th&iacute;ch kiểu d&aacute;ng vu&ocirc;ng vức, vị tr&iacute; cảm biến v&acirc;n tay thuận tiện, c&acirc;y b&uacute;t S-Pen hữu &iacute;ch cho c&ocirc;ng việc, hay bạn đơn giản chỉ l&agrave; một fan trung th&agrave;nh của d&ograve;ng Note, th&igrave; Note FE l&agrave; sự lựa chọn tốt nhất hiện nay m&agrave; bạn c&oacute; thể c&oacute; được.&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;&lt;img alt=&quot;
Kh&aacute;c với hộp của Galaxy Note7 (tr&aacute;i), hộp của Galaxy Note FE sở hữu một h&igrave;nh tr&aacute;i tim lớn​
&quot; src=&quot;http://genknews.genkcdn.vn/thumb_w/660/2017/dscf9695-1499425939488.jpg&quot; /&gt;&lt;/p&gt;

&lt;p&gt;Kh&aacute;c với hộp của Galaxy Note7 (tr&aacute;i), hộp của Galaxy Note FE sở hữu một h&igrave;nh tr&aacute;i tim lớn​&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;&lt;img alt=&quot;
Mặt sau l&agrave; một số th&ocirc;ng tin về cấu h&igrave;nh của sản phẩm
&quot; src=&quot;http://genknews.genkcdn.vn/thumb_w/660/2017/dscf9660-1499424890392.jpg&quot; /&gt;&lt;/p&gt;

&lt;p&gt;Mặt sau l&agrave; một số th&ocirc;ng tin về cấu h&igrave;nh của sản phẩm&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;&lt;img alt=&quot;
B&ecirc;n cạnh c&aacute;c phụ kiện truyền thống, Galaxy Note FE c&ograve;n đi k&egrave;m một flip cover Clear View Cover
&quot; src=&quot;http://genknews.genkcdn.vn/thumb_w/660/2017/dscf9664-1499424890382.jpg&quot; /&gt;&lt;/p&gt;

&lt;p&gt;B&ecirc;n cạnh c&aacute;c phụ kiện truyền thống, Galaxy Note FE c&ograve;n đi k&egrave;m một flip cover &quot;Clear View Cover&quot;&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;&lt;img alt=&quot;
Flip cover n&agrave;y được sản xuất tại Việt Nam
&quot; src=&quot;http://genknews.genkcdn.vn/thumb_w/660/2017/dscf9681-1499424890335.jpg&quot; /&gt;&lt;/p&gt;

&lt;p&gt;Flip cover n&agrave;y được sản xuất tại Việt Nam&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;&lt;img alt=&quot;
Mặt trước của flip cover n&agrave;y hơi mờ đục, đủ để người d&ugrave;ng thấy m&agrave;n h&igrave;nh Always-on Display
&quot; src=&quot;http://genknews.genkcdn.vn/thumb_w/660/2017/dscf9683-1499424890332.jpg&quot; /&gt;&lt;/p&gt;

&lt;p&gt;Mặt trước của flip cover n&agrave;y hơi mờ đục, đủ để người d&ugrave;ng thấy m&agrave;n h&igrave;nh Always-on Display&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;&lt;img alt=&quot;
Mặt lưng của m&aacute;y khi lắp flip cover
&quot; src=&quot;http://genknews.genkcdn.vn/thumb_w/660/2017/dscf9684-1499424890319.jpg&quot; /&gt;&lt;/p&gt;

&lt;p&gt;Mặt lưng của m&aacute;y khi lắp flip cover&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;&lt;img alt=&quot;
M&aacute;y sẽ tự động mở kh&oacute;a/kh&oacute;a khi người d&ugrave;ng mở/gập flip cover
&quot; src=&quot;http://genknews.genkcdn.vn/2017/img-7304-1499426220781.gif&quot; /&gt;&lt;/p&gt;

&lt;p&gt;M&aacute;y sẽ tự động mở kh&oacute;a/kh&oacute;a khi người d&ugrave;ng mở/gập flip cover&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;&lt;img alt=&quot;
Đ&acirc;y l&agrave; Galaxy Note FE m&agrave;u v&agrave;ng
&quot; src=&quot;http://genknews.genkcdn.vn/thumb_w/660/2017/dscf9665-1499424890390.jpg&quot; /&gt;&lt;/p&gt;

&lt;p&gt;Đ&acirc;y l&agrave; Galaxy Note FE m&agrave;u v&agrave;ng&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;&lt;img alt=&quot;
Một sự kh&aacute;c biệt cơ bản của Galaxy Note Fan Edition so với Galaxy Note7 m&agrave; người d&ugrave;ng c&oacute; thể dễ ph&acirc;n biệt l&agrave; t&ecirc;n m&aacute;y được in ở mặt lưng
&quot; src=&quot;http://genknews.genkcdn.vn/thumb_w/660/2017/dscf9669-1499424890369.jpg&quot; /&gt;&lt;/p&gt;

&lt;p&gt;Một sự kh&aacute;c biệt cơ bản của Galaxy Note Fan Edition so với Galaxy Note7 m&agrave; người d&ugrave;ng c&oacute; thể dễ ph&acirc;n biệt l&agrave; t&ecirc;n m&aacute;y được in ở mặt lưng&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;&lt;img alt=&quot;
Do đ&acirc;y l&agrave; phi&ecirc;n bản H&agrave;n Quốc, Galaxy Note FE kh&ocirc;ng c&oacute; logo Samsung
&quot; src=&quot;http://genknews.genkcdn.vn/thumb_w/660/2017/dscf9670-1499424890366.jpg&quot; /&gt;&lt;/p&gt;

